import React from 'react'

export default function Contribute() {
    const [formData, setFormData] = useState({
        noteId: '',
        email: '',
      });

      const handleChange = (e) => {
        setFormData({
          ...formData,
          [e.target.name]: e.target.value,
        });
      };

      const handleSubmit = (e) => {
        e.preventDefault();
        // Call the onSubmit function passed as props, with the note ID and email
        onSubmit(formData);
      };

      return (
        <div className="modal" id="contributeModal" tabIndex="-1" aria-labelledby="contributeModalLabel" aria-hidden="true">
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title" id="contributeModalLabel">Contribute to Note</h5>
                <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
              </div>
              <div className="modal-body">
                <form onSubmit={handleSubmit}>
                  <div className="mb-3">
                    <label htmlFor="noteId" className="form-label">Note ID</label>
                    <input
                      type="text"
                      className="form-control"
                      id="noteId"
                      name="noteId"
                      value={formData.noteId}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="mb-3">
                    <label htmlFor="email" className="form-label">Contributor's Email</label>
                    <input
                      type="email"
                      className="form-control"
                      id="email"
                      name="email"
                      value={formData.email}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <button type="submit" className="btn btn-primary">Share Note</button>
                </form>
              </div>
            </div>
          </div>
        </div>
      );
    }
